import React from 'react';

const ProgressBar = ({ completeColor, completed }) => {


    const fillerStyles = {
        width: `${completed}%`,
        backgroundColor: completeColor,
        /*role: ProgressBar,
        ariaValuenow: `${completed}`,
        ariaValuemin: 0,
        ariaValuemax: 100,
        maxWidth: 1140,
        minWidt:0*/
    }
    
    const fillerStyles2 = {
        width: `${'100' - completed}%`,
        /*role: ProgressBar,
        ariaValuenow: `${completed}`,
        ariaValuemin: 0,
        ariaValuemax: 100,
        maxWidth: 1140,
        minWidt:0*/
    }

    return (
        <div className="ProgressBar">
            <div style={fillerStyles}>
                <span className="ProgressBar__text">{`${'1 неделя'}`}</span>
            </div>
            <div style={fillerStyles2}>
                <span className="ProgressBar__text">{`${'4 недели'}`}</span>
            </div>
        </div>
    );
};

export default ProgressBar;
